import React from 'react';

function Field(props) {
  switch (props.fieldName) {
    case 'username':
      return (
        <div class="field">
          <label htmlFor="scriptName">Username * </label>
          <input
            type="text"
            id="username"
            name="username"
            onChange={props.onChange}
          ></input>
          {addWhitespace()}
        </div>
      );
    case 'nickname':
      return (
        <div class="field">
          <label htmlFor="errorCodes">Nickname * </label>
          <input
            type="text"
            name="errorCodes"
            onChange={props.onChange}
          ></input>
          {addWhitespace()}
        </div>
      );
    case 'password':
      return (
        <div class="field">
          <label id="numAccLabel" htmlFor="numAcc">
            Password *{' '}
          </label>
          <input
            id="numAccInput"
            type="number"
            name="numAcc"
            onChange={props.onChange}
          ></input>
          {addWhitespace()}
        </div>
      );
  }

  function addWhitespace() {
    return (
      <div>
        <br></br>
      </div>
    );
  }
}
export default Field;
